import regimg from './assets/3456426.png';
import { Signup } from './components/Signup';
import './App.css';
 
function App() {
  return (
    <div className="container mt-3">
      <div className="row">
        <div className="col-md-6 my-auto">
          <img className="img-fluid w-100" src={regimg} alt=""/>
        </div>
        <div className="col-md-6">
          <Signup />
        </div>
      </div>
    </div>
  );
}
 
export default App;
